import React, { Component } from 'react';

export default class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <p className="footer1">Home</p>
        <p className="footer1">News</p>
        <p className="footer1">Live</p>
        <p className="footer1">Social</p>
      </div>
    );
  }
}
